import React from 'react';
import img1 from './img/1.jpg';
import img2 from './img/2.jpg';
import img3 from './img/3.jpg';
import img4 from './img/4.jpg';
import {ReactComponent as FlechaIzquierda} from './img/iconmonstr-angel-left-thin.svg';
import {ReactComponent as FlechaDerecha} from './img/iconmonstr-angel-right-thin.svg';
import style from 'styled-components';

const Slideshow = () => {
  return (
    <ContenedorPrincipal>
        <Slide>
            <a href="https://7alegz.github.io">
                <img src={img1} alt="" />
            </a>
            <TextoSlide>
              <p>15% de Descuento en productos Apple</p>
            </TextoSlide>
        </Slide>
        <div>
          <button>
            <FlechaIzquierda />
            <FlechaDerecha />
          </button>
        </div>
    </ContenedorPrincipal>
  );
}

export default Slideshow;
